INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(1, 'Vseviov salajasest rahuplaanist: see ei peegelda terviklikku pakkumist', 'Välismeediast lekkinud võimaliku Ukraina rahuplaani elemendid, mis näevad muu hulgas ette Ukraina alade loovutamist Venemaale, ei peegelda terviklikku pakkumist, ütles välisministeeriumi kantsler Jonatan Vseviov \"Vikerhommikus\". Ta lisas, et Eesti koos liitlastega tegeleb tegeliku olukorra välja selgitamisega.\r\n\r\n\"Kui maailm aktsepteerib seda, et piire saab relva jõul muuta või seda, et Venemaal on mingisugused õigused imperiaalsetele huvidele väljaspool oma rahvusvaheliselt tunnustatud piire, siis meie jaoks on loomulikult olukord kaugelt täbaram kui see olukord, mis rahvusvahelises ruumis on võimaldanud Eesti omariiklust ja iseseisvussõltumatust kindlustada,\" ütles Vseviov.', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(2, 'Kultuuriminister toetab komisjoni eitavast otsusest sõltumata Theatrumit ja Elektroni', 'Kultuuriministeerium avaldas etendusasutuste taotlusvooru tulemused ja lõpliku hindamisprotokolli ning ka pärast teatrite esitatud vastuväiteid jäid endiselt riikliku rahastuseta Theatrum ja Elektron.art. Kultuuriminister Heidy Purga aga eraldab neile erakorralise üleminekutoetuse.\r\n\r\nMinister rõhutas, et hindamiskomisjonide töö ning ekspertotsused on kultuuripoliitika loomulik ja vajalik osa.\r\n\r\n\"Samas peame hoidma elus ka neid kultuurikandjaid, kelle roll ja mõju ulatuvad kaugemale tavapärastest hindamiskriteeriumidest. Nende panust ei saa alati mõõta pelgalt projektipunktide raamides,\" lausus ta.', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(3, 'Mure turuhäirete pärast tõstab Euroopas diislikütuse hinda', 'Investorid kardavad, et Moskva-vastased sanktsioonid ja mitme rafineerimistehase sulgemine võivad vähendada pakkumist ja mure turuhäirete pärast tõstab Euroopa turul diislikütuse hinda.\r\n\r\nAjaleht Financial Times kirjutab, et Euroopa diislikütuse hinnad tõusid kolmapäeval järsult. Diislikütuse ja Brenti toornafta futuuride vahe ICE Futures Europe börsil tõusis 34 dollarini barreli kohta, mis on suurim määr alates 2023. aasta septembrist. \r\n\r\nDiislikütuse juurdehindlus Brenti suhtes on tõusnud alates selle aasta juunist, mil vahe oli umbes 16 dollarit barreli kohta. \r\n\r\nFinantsfirma UBS analüütik Giovanni Staunovo ütles, et investorid reageerivad lühiajalisele pakkumise vähenemisele, samas nõudlus on oodatust suurem. Mitu rafineerimistehast on töö peatanud või vähendanud tootmist. ', , 2, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(4, 'Isa Khalilovit hoiab Eestis kohtu määratud käitumiskontroll', 'Politsei- ja piirivalveamet (PPA) tühistas küll vanglast vabanenud Vene kodaniku Isa Khalilovi elamisloa, kuid meest Eestist välja saata ei saa, sest ta on kohtu korraldusel kriminaalhooldusel ning enne selle lõppu või kohtu uut otsust teda Eestist lahkuma ei saa sundida.\r\n\r\nSel nädalal tühistas PPA 2020. aastal ränga autoavarii põhjustanud Vene kodaniku Isa Khalilovi elamisloa, kuid vanglast ennetähtaegselt vabanenud meest riigist välja saatmine lähiajal ei oota, sest kohtulahend annab talle õiguse Eestis viibida.\r\n\r\nNimelt otsustas ringkonnakohus oma määruses, et Khalilov vabastatakse ennetähtaegselt katseajaga juunini 2030 ning talle kehtib kaheaastane käitumiskontroll, mil ta peab kohtuma regulaarselt kriminaalhooldajaga. Aastaks pandi Khalilovile ka jälgimisseade.', , 3, 1);

